function Color(r,g,b,a)
{
	let hex;
	hex = "#" + (r | 1 << 8).toString(16).slice(1) +(g | 1 << 8).toString(16).slice(1) +(b | 1 << 8).toString(16).slice(1);
	if (a != null) 
	{	
		hex = hex + (a | 1 << 8).toString(16).slice(1);
	}
	return hex;
}
function draw_thumby(context,x,y)
{
	for(let j=0;j<thumby.length;j++)
	{
		for(let i=0;i<thumby[0].length;i++)
		{
			context.fillStyle = Color(thumby[j][i][0],thumby[j][i][1],thumby[j][i][2],thumby[j][i][3]);
			context.fillRect(j,i,1,1);
		}
	}
}
