function collide(ax,ay,aw,ah,bx,by,bw,bh)
{
	if(ax<bx+bw &&
	ax+aw>bx &&
	ay+ah>by &&
	ay<by+bh) return 1;
	return 0;
}
function load_event()
{	
	document.addEventListener('keydown',
	function(e){   
		if(e.key === 'e')
		{ 
			gamepad.A=1;
		}
		else if(e.key==='f')
		{
			gamepad.B=1;
		}
		else if(e.key==='ArrowUp')
		{
			gamepad.U=1;
		}
		else if(e.key==='ArrowDown')
		{
			gamepad.D=1;
		}
		else if(e.key==='ArrowLeft')
		{
			gamepad.L=1;
		}
		else if(e.key==='ArrowRight')
		{
			gamepad.R=1;
		}
	});
	document.addEventListener('keyup',
	function(e){
		if(e.key === 'e')
		{ 
			gamepad.A=0;
		}
		else if(e.key==='f')
		{
			gamepad.B=0;
		}
		else if(e.key==='ArrowUp')
		{
			gamepad.U=0;
		}
		else if(e.key==='ArrowDown')
		{
			gamepad.D=0;
		}
		else if(e.key==='ArrowLeft')
		{
			gamepad.L=0;
		}
		else if(e.key==='ArrowRight')
		{
			gamepad.R=0;
		}
	});
	canvas.addEventListener("touchstart",
	function(e){
		console.log("touch");
		e.preventDefault();
		touches = e.touches;
		let v;
		//mouse.x = touches[0].clientX;
		//mouse.y = touches[0].clientY;
		//mouse.btnG = 1;
		let i=0;
		console.log("x: "+touches[0].clientX+" y: "+touches[0].clientY);
		for(let i=0;i<touches.length;i++)
		{
			for(v in g_gamepad)
			{ 
				let lk = g_gamepad[v];
				if(collide(touches[i].clientX,touches[i].clientY,6,6,lk.x,lk.y,lk.w,lk.h)==1)
				{
					console.log("touch gamepad"+v+" "+lk);
			
					if(v==="A")gamepad.A=1;
					else if(v==="B")gamepad.B=1;
					else if(v==="U")gamepad.U=1;
					else if(v==="D")gamepad.D=1;
					else if(v==="R")gamepad.R=1;
					else if(v==="L")gamepad.L=1;
				}
			}
		}
	},false);
	canvas.addEventListener("touchend",
	function(e){
		e.preventDefault();
		console.log("touch end");
		for(let i=0;i<touches.length;i++)
		{
			for(let v in g_gamepad)
			{ 
				let lk = g_gamepad[v];
				if(collide(touches[i].clientX,touches[i].clientY,6,6,lk.x,lk.y,lk.w,lk.h)==1)
				{
					console.log("touchend gamepad"+v+" "+lk);
					if(v==="A")gamepad.A=0;
					else if(v==="B")gamepad.B=0;
					else if(v==="U")gamepad.U=0;
					else if(v==="D")gamepad.D=0;
					else if(v==="R")gamepad.R=0;
					else if(v==="L")gamepad.L=0;
				}
			}
		}
		touches=[];
	},false);
}

