let scale=2;
context.fillStyle="#000000";
context.fillRect(screen.x,screen.y,screen.w*scale,screen.h*scale);
context.fillStyle="#FFFFFF";
function game(time){
	window.requestAnimationFrame(game);
	dt = (time - derniereUpdate) / 1000;
	if (dt < (1 / freq) - 0.001) return;
	fps = 1 / dt;
	derniereUpdate = time;
	if(document.readyState=="complete")
	{ 
		if(WTU!=undefined) WTU();
	}
}
function TobinStr(d)
{
	let i;
	if(typeof(d)=="number")
	{
		let l = d.toString(2);
			for(i=l.length;i<8;i++)
			{
				l = "0"+l;
			}
		return l;
	}
	return "";
}
